    function gen_share(uint256[] memory array, uint x) public view returns(uint256){
        uint256 ans = 0;
        uint256 o = G.GEN_ORDER;
        for(uint i=0; i<array.length; i++){
            ans = addmod(ans , mulmod(array[i],G.expMod(x,i,o),o),o); 
        }
        return ans % o;
    }

