        uint256[] memory validators_share = new uint256[](nv);
        uint256[] memory openers_share = new uint256[](no);
        uint256 kr = gen_random();
        id_kr[hash_to_int(cm)] = kr;

        poly_validators[0] = kr;
        poly_openers[0] = kr;
        for(uint i=1; i<tv; i++){
            poly_validators[i] = gen_random();
        }
        for(uint i=1; i<to; i++){
